import React from "react";
import './App.css';
import Header from "./components/Header";
import MemeGenerator from "./components/MemeGenerator";


function App() {
  return (
    <div className="App">
      <Header />
      <div className="main-container">
        <MemeGenerator />
      </div>


    </div>
  );
}

export default App;
